import React from "react";

function Page(props) {
    if (prop.pages && props.pages.length > 0) {
        const pages = props.pages;
        let listPages;
            listPages = pages.map((page) => {
                return <li>{pages.name}</li>
            });
        return (
            <ul>{listPages}</ul>
        )
        }
}

export default Page;
